import React, { useState } from "react";
import Form from "react-bootstrap/Form";
import Button from "react-bootstrap/Button";
import Container from "react-bootstrap/Container";
import Jumbotron from "react-bootstrap/Jumbotron";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";

const OwnerComponent = ({ submitOwner }) => {
  const [ownerName, setOwnerName] = useState("");
  const [ownerCpf, setOwnerCpf] = useState("");
  const [ownerData, setOwnerData] = useState("");
  const [ownerSexo, setOwnerSexo] = useState("");

  const handleSubmitOwner = () => {
    submitOwner(ownerName, ownerCpf, ownerData, ownerSexo);
  };

  return (
    <>
      <br />
      <Container>
        <Row>
          <Col md={{ span: 12, offset: 0 }}>
            <Jumbotron style="background-color: #0000">
              <Form>
                <h2>Cadastro</h2>
                <Form.Group>
                  <Form.Label>Nome Completo</Form.Label>
                  <Form.Control
                    type="text"
                    name="ownerName"
                    onChange={(e) => {
                      setOwnerName(e.target.value);
                    }}
                  />
                </Form.Group>
                <Form.Group>
                  <Form.Label>CPF</Form.Label>
                  <Form.Control
                    type="text"
                    name="ownerCpf"
                    onChange={(e) => {
                      setOwnerCpf(e.target.value);
                    }}
                  />
                </Form.Group>
                <Form.Group controlId="formNascimento">
                  <Form.Label>Data de Nascimento</Form.Label>
                  <Form.Control
                    type="date"
                    name="ownerData"
                    onChange={(e) => {
                      setOwnerData(e.target.value);
                    }}
                  />
                </Form.Group>
                <Form.Row>
                  <Form.Group as={Col} controlId="formGridSex">
                    <Form.Label>Sex</Form.Label>
                    <Form.Check
                      type="radio"
                      label="Masculino"
                      name="formHoriRadios"
                      ids="formHoriRadios1"
                      value="M"
                    />
                    <Form.Check
                      type="radio"
                      label="Feminino"
                      name="formHoriRadios"
                      ids="formHoriRadios1"
                      value="F"
                    />
                  </Form.Group>
                </Form.Row>
                <Button variant="primary" type="submit" onClick={handleSubmitOwner}>
                  Cadastrar
                </Button>
              </Form>
            </Jumbotron>
          </Col>
        </Row>
      </Container>
    </>
  );
};

export default OwnerComponent;
